{"code":"switch ( '[cb_details_birthday_style]' ) {
	case 'BIRTHDAY_YEAR':
	case 'BIRTHDAY_AGEYEAR':
		return cbFormatDate( '[cb_details_birthday]', false, false, 'Y' );
		break;
	case 'BIRTHDAY_MONTH':
	case 'BIRTHDAY_AGEMONTH':
		return cbFormatDate( '[cb_details_birthday]', false, false, 'F' );
		break;
	case 'BIRTHDAY_DAYMONTH':
	case 'BIRTHDAY_AGEDAYMONTH':
		return cbFormatDate( '[cb_details_birthday]', false, false, 'F j' );
		break;
	case 'BIRTHDAY_MONTHYEAR':
	case 'BIRTHDAY_AGEMONTHYEAR':
		return cbFormatDate( '[cb_details_birthday]', false, false, 'F Y' );
		break;
	case 'BIRTHDAY_DATE':
	case 'BIRTHDAY_AGEDATE':
		return cbFormatDate( '[cb_details_birthday]', false, false );
		break;
}"}
